import React from 'react'
import Header from './Header'
import Style from './Layout'

const Layout = ({children}) => {
  return (
    <div className={Style.wrapper}>
      <Header />
      <div className={Style.main}>
        {children}
      </div>
    </div>
  )
}

export default Layout
